import React from 'react';
import logo from './images/Podnet.png';
import './Sidebar.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './Sidebar.css';
import facebook from './images/facebook.svg';
import instagram from './images/instagram.svg';
import linkedin from './images/linkedin.svg'

class SidebarContents extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: 'Tony Stark',
            password: 'IamIronMan'
        };

        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(event) {
        this.setState({ value: event.target.value });
    }

    render() {
        return (
            <div className="col">
                <div classname="row-md">
                    <img src={logo} alt="logo" class="logo-opacity1"/>
                    <p>Where world talks!
                        About Anything And Everything!</p>
                </div>
                <div classname="row-md">
                    <Form>
                        <Form.Group controlId="formBasicEmail">
                            <Form.Label style={{ color: 'white' }}>Email address:</Form.Label>
                            <Form.Control type="email" placeholder="Enter email, e.g. TonyStark@gmail.com" />
                            <Form.Text className="text-muted" style={{ color: 'white' }}>
                                We'll share your email with everyone else if you believe Tony Stark will use Gmail, otherwise you're safe with us.
    </Form.Text>
                        </Form.Group>

                        <Form.Group controlId="formBasicPassword">
                            <Form.Label style={{ color: 'white' }} >Password</Form.Label>
                            <Form.Control type="password" placeholder="Password, e.g. IamIronMan" />
                        </Form.Group>
                        <Button variant="outline-primary" type="submit" style={{ margin: '10px' }}>
                            Submit
  </Button>

                    </Form>
                </div>
            </div>
        )
    }
}

export default SidebarContents;
